import '../App.css';
import klara from "../images/klara.avif"
function Peeking() {
    return (
    <div className="app">
        <h1 className='title'>Er du her før tida?</h1>
        <h3 id="warning">No må du ikkje sniktitte...
        </h3>
        <img src={klara} alt="Klara følger med" width="400px"></img>
    </div>

    );
  }

export default Peeking;
